import './App.css';
import React, { Component }  from 'react'
import {BrowserRouter as Router, Routes,Route, RouterProvider} from "react-router-dom";
function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route index element={<h1>Hello World</h1>}></Route>
        </Routes>
      </Router>
      {/* <h1>Hello</h1> */}
    </div>
  );
}

export default App;
